var script_f36_16_37133=[""].join("\n");
var outline_f36_16_37133=null;
var title_f36_16_37134="Tolerance to ISDN";
var content_f36_16_37134=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F61032&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=0\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F61032&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=0\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 526px\">",
"   <div class=\"ttl\">",
"    Tolerance to sustained isosorbide dinitrate",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 506px; height: 277px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Duration of action of single oral doses of ISDN or placebo during acute and sustained therapy in 12 patients with stable angina. Compared to placebo, ISDN was associated with an increase in exercise time to angina that persisted for eight hours during acute therapy but was attenuated in degree and lasted for only two hours during sustained therapy. The improvement was dose-dependent up to the 30 mg dose; there was no further improvement with the 60 mg (not shown) and 120 mg doses.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from Thadani U, Fung H, Darke AC, Parker JO. Am J Cardiol 1982; 49:411.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
